B.Yi=new A.aq("Jetzt mal umgekehrt! \n\nDir ist sicher schon aufgefallen, dass die Sachen nicht immer so klingen, wie sie auf Deutsch geschrieben werden. Das liegt daran, dass man sich auf fixe Regeln geeinigt hat, wie man die Koreanische Schrift transkribiert. Bei den folgenden W\xf6rtern, klingt das so, als w\xe4re der Anfangsbuchstabe hart, obwohl es eigentlich mit einem Weichen geschrieben wird:",null,B.L,null,null,null,null,null,null)
