B.Yq=new A.aq("Doppelkonsonanten sind sch\xe4rfere Versionen der Einzelkonsonanten. Sie werden produziert, indem man etwas mehr Druck im Mund aufbaut und dann den Konsonanten schnell ausspricht. Folgende Konsonanten k\xf6nnen verdoppelt werden: \n\n \u3131 (g) --> \u3132 (kk) \n\u3137 (d) --> \u3138 (tt)\n\u3142 (b) --> \u3143 (pp) \n\u3145 (s) --> \u3146 (ss)\n\u3148 (j) --> \u3149 (jj)",null,B.L,null,null,null,null,null,null)
B.Yr=new A.aq('Der Buchstabe "\u3145" wird meisten mit einem "s" transkribiert, kann aber auf drei verschiedene Arten ausgesprochen werden. \n\n1. in Kombination mit einem "i", klingt es wie bei dem Wort "SCHIff": \n \uc2dc = \u3145 + \u3163 (shi)  \n\n2. In Kombination mit jedem anderen Vokal, klingt es wie bei dem Wort "naSS":\n \uc0ac = \u3145 + \u314f (sa) \n\n3. Am Ende einer Silbe schlie\xdft man denn Mund bevor man die Luft durchl\xe4sst, weshalb es klingt wie ein "t": \n \uad7f = \u3131 + \u315c + \u3145 (gut)',null,B.L,null,null,null,null,null,null)
